import React, { Component } from "react";

import api from "../api";

class Admin extends Component {
  state = {
    saves: [],
  };

  componentDidMount() {
    api
      .saves("Histopolio")
      .then((res) => {
        this.setState({
          saves: res.data,
        });
      })
      .catch((error) => {
        console.log(error.message);
      });
  }

  render() {
    return (
      <div className="text-center">
        {this.state.saves.map((save) => {
          return (
            <div class="card">
              <div class="card-body">
                <h4 class="card-title">
                  {save.substring(0, save.indexOf(".json"))}
                </h4>
              </div>
            </div>
          );
        })}
      </div>
    );
  }
}

export default Admin;
